INSERT  INTO `ta_pengumuman`(`id`,`diumumkan_di`,`sticky`,`title`,`content`,`published`,`user_id`,`created_at`,`updated_at`) VALUES (1,3,0,'Selamat Datang di BosSTAN','<p>Selamat Datang di BosSTAN. Aplikasi pengelolaan keuangan dana Bantuan Operasional Sekolah.</p>\r\n\r\n<p>Aplikasi ini terdiri dari 3 modul utama, yaitu anggaran, penatausahaan dan pelaporan. Selain itu tersedia modul tambahan untuk Data Sekolah dan Data Pejabat Sekolah.</p>\r\n\r\n<table class=\"table table-bordered table-hover table-striped\" style=\"width:500px\">\r\n	<thead>\r\n		<tr>\r\n			<th scope=\"row\">No</th>\r\n			<th scope=\"col\">Modul</th>\r\n			<th scope=\"col\">Keterangan</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<th scope=\"row\">1</th>\r\n			<td>Pengaturan</td>\r\n			<td>Pada menu ini anda dapat mengisi informasi pengaturan seperti data sekolah, data jabatan di sekolah.</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">2</th>\r\n			<td>Anggaran</td>\r\n			<td>\r\n			<p>Dalam penganggaran penginputan terdiri dari</p>\r\n\r\n			<ol>\r\n				<li>Input data pendapatan dan belanja pada RKAS</li>\r\n				<li>Input data perkiraan waktu penerimaan pendapatan dan pengeluaran belanja melalui Rencana RKAS. Disini anda akan diminta mengisi pada bulan mana penerimaan dan pengeluaran dilakukan</li>\r\n				<li>Posting Penetapan Anggaran jika anggaran tersebut sudah disetujui untuk ditetapkan.</li>\r\n			</ol>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">3</th>\r\n			<td>Penatausahaan</td>\r\n			<td>Penatausahaan terdiri dari penginputan penerimaan pendapatan, pengisian saldo awal yang berupa saldo dari dana tahun lalu yang tidak habis digunakan, pengeluaran belanja, dan pembuatan SPJ setiap periode.</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">4</th>\r\n			<td>Pelaporan</td>\r\n			<td>Pada pelaporan anda dapat mencetak seluruh data kebutuhan BOS sesuai dengan Juknis Pengelolaan dana BOS</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n',1,1,1486986729,1510628966),(2,1,1,'apa aja deh','<p>test terst</p>\r\n',1,3,1493855548,1493855548),(3,1,0,'test lagi ......','<p>test....test....test......</p>\r\n',1,1,1495598361,1495598361),(4,1,1,'Lembur Kerja ','',1,1,1510629040,1510629040),(5,1,0,'kopi break dulu ya .....','<p>test.........................break</p>\r\n',1,1,1510632864,1510645037);

