/* Procedure structure for procedure `sisa_kas` */

/*!50003 DROP PROCEDURE IF EXISTS  `sisa_kas` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `sisa_kas`(IN `p_tahun` YEAR,IN `p_sekolah_id` INT,IN `p_pembayaran` INT,IN `p_tgl_bukti` DATE)
BEGIN
SELECT
	a.tahun, a.sekolah_id, SUM(a.nilai) AS nilai
	FROM
	(
		SELECT tahun, sekolah_id, SUM(nilai) AS nilai FROM ta_spj_rinc WHERE tahun = p_tahun AND sekolah_id = p_sekolah_id AND 
			(CASE 
				WHEN p_pembayaran = 1 THEN pembayaran = 1 
				WHEN p_pembayaran = 2 THEN pembayaran = 2
			END)
		AND Kd_Rek_1 = 4 AND tgl_bukti <= p_tgl_bukti GROUP BY tahun, sekolah_id
		UNION ALL
		SELECT tahun, sekolah_id, SUM(nilai) AS nilai FROM ta_saldo_awal WHERE tahun = p_tahun AND sekolah_id = p_sekolah_id AND
			(CASE 
				WHEN p_pembayaran = 1 THEN pembayaran = 1 
				WHEN p_pembayaran = 2 THEN pembayaran = 2
			END)
		GROUP BY tahun, sekolah_id
		UNION ALL
		SELECT tahun, sekolah_id, -(SUM(nilai)) AS nilai FROM ta_spj_rinc WHERE tahun = p_tahun AND sekolah_id = p_sekolah_id AND  
			(CASE 
				WHEN p_pembayaran = 1 THEN pembayaran = 1 
				WHEN p_pembayaran = 2 THEN pembayaran = 2
			END)
		 AND Kd_Rek_1 = 5 AND tgl_bukti <= p_tgl_bukti GROUP BY tahun, sekolah_id
		UNION ALL
		SELECT tahun, sekolah_id, -(SUM(nilai)) AS nilai FROM ta_mutasi_kas WHERE tahun = p_tahun AND sekolah_id = p_sekolah_id AND  
			(CASE 
				WHEN p_pembayaran = 1 THEN kd_mutasi = 1 
				WHEN p_pembayaran = 2 THEN kd_mutasi = 2
			END)
		 AND tgl_bukti <= p_tgl_bukti GROUP BY tahun, sekolah_id
		UNION ALL
		SELECT tahun, sekolah_id, SUM(nilai) AS nilai FROM ta_mutasi_kas WHERE tahun = p_tahun AND sekolah_id = p_sekolah_id AND   
			(CASE 
				WHEN p_pembayaran = 1 THEN kd_mutasi = 2 
				WHEN p_pembayaran = 2 THEN kd_mutasi = 1
			END)
		  AND tgl_bukti <= p_tgl_bukti GROUP BY tahun, sekolah_id
	)a GROUP BY a.tahun, a.sekolah_id
;
